@import 'scss/variables';
.wrapper {
  font-family: "Rubik", sans-serif;
  font-weight: 100;
  color: $bg_color;
  margin: 0 auto;
  box-sizing: border-box;
  a {
    color: $bg_color;
    text-decoration: none;
    &:hover {
      color: initial;
    }
  }
  .company-name {
    font-weight: 500;
  }
  .btn {
    outline: none;
    border: none;
    background-color: $pink;
    border-radius: 10px;
    box-shadow: 0px 30px 54px -10px rgba(245, 56, 56, 0.35);
  }
  ul {
    padding: 0;
    margin: 0;
    li {
      list-style: none;
    }
  }
  .section-heading {
    color: #0b132a;
    font-weight: 500;
    font-size: 2rem;
    line-height: 3.125rem;
  }
  .section-des {
    margin-top: 20px;
  }

  .nav {
    padding-top: 50px;
    padding-bottom: 90px;
    @media screen and (max-width: 768px) {
      padding: 2rem 0;
    }
    &-menu {
      @media screen and (max-width: 1023px) {
        display: none !important;
      }
      li {
        list-style: none;
        a {
          color: $bg_color;
          text-decoration: none;
        }
      }
      li:not(:last-child) {
        margin-right: 40px;
      }
    }
    &-button {
      a {
        color: #000;
        font-weight: 500;
        text-decoration: none;
        margin-right: 0.5rem;
        padding: 12px 3rem;
        border-radius: 20px;
        @media screen and (max-width: 768px) {
          padding: 3px 6px;
        }
        &:hover {
          color: #f53855;
          outline: #f53855 solid 1px;
          transition: all 0.3 ease;
        }
      }
      a.active {
        color: #f53855;
        outline: #f53855 solid 1px;
      }
    }
    &-logo {
      font-weight: 300;
      @media screen and (max-width: 576px) {
        img {
          width: 120px;
        }
      }
    }
  }
  .intro {
    padding-bottom: 100px;
    @media screen and (max-width: 768px) {
      padding-bottom: 3rem;
    }
    &-left {
      width: 50%;

      &__heading {
        font-weight: 500;
        font-size: 50px;
        line-height: 70px;
        color: #0b132a;
      }
      &__text {
        span {
          font-weight: 400;
        }
      }
      &__btn {
        outline: none;
        border: none;
        background-color: $pink;
        border-radius: 10px;
        box-shadow: 0px 30px 54px -10px rgba(245, 56, 56, 0.35);
        padding: 0.8rem 4rem;
      }
      @media screen and (max-width: 768px) {
        width: 100%;
        order: 2;
        &__heading {
          font-size: 2rem;
          line-height: 1.4;
        }
      }
    }
    &-right {
      width: 50%;
      @media screen and (max-width: 768px) {
        width: 100%;
        order: 1;
      }
      img {
        width: 100%;
        height: auto;
        object-fit: cover;
      }
    }
  }
  .metric {
    padding: 4.5rem 0;
    box-shadow: 0px 30px 114px -10px rgba(13, 16, 37, 0.06);
    border-radius: 10px;
    .metric-col {
      .metric-item {
        &__icon {
          margin-right: 2rem;
        }
        &__text {
          .number {
            font-size: 25px;
          }
          .text {
            font-size: 20px;
          }
        }
      }
    }

    .metric-col:not(:last-child) {
      border-right: 2px solid #eeeff2;
    }
    @media screen and (max-width: 767px) {
      padding: 2rem 0;
      .metric-col:not(:last-child) {
        border-right: none;
      }
      .metric-col {
        .metric-item {
          &__icon {
            margin-right: 0;
          }
        }
      }
    }
  }
  .features {
    padding-top: 3.375rem;
    padding-bottom: 8.25rem;
    &-img {
      padding-left: 2rem;
      img {
        width: 100%;
        height: auto;
        object-fit: cover;
      }
    }
    &-content {
      padding: 0 9rem;
      .heading {
        color: #0b132a;
        font-weight: 500;
        font-size: 2rem;
        line-height: 3.125rem;
      }
      .des {
        margin-top: 20px;
      }
      ul {
        line-height: 1.875rem;
        li {
          list-style: none;
          padding: 0;
          font-size: 14px;
          margin-top: 1rem;
          padding-left: 2rem;
          position: relative;
          &::before {
            content: "";
            position: absolute;
            top: 50%;
            left: 0;
            transform: translateY(-50%);
            width: 24px;
            height: 24px;
            background: url("/static/check.svg") no-repeat center / cover;
          }
        }
      }
    }
    @media screen and (max-width: 1200px) {
      padding: 3rem 0;
      &-content {
        padding: 0 2rem;
      }
    }
  }
  .plan {
    background-color: #fbfbfb;
    padding: 5rem;
    flex: 1;

    .heading {
      font-size: 35px;
      color: #0b132a;
      font-weight: 500;
    }
    .des {
      padding-top: 20px;
    }
    .plan-wrapper {
      padding-top: 60px;
      .plan-item-wrapper {
        padding: 0 25px;
        .plan-item {
          padding: 5rem 4.5rem 4.5rem 4rem;
          background-color: #fff;
          height: 100%;
          border: 2px solid #dddddd;
          border-radius: 10px;
          .plan-type {
            font-weight: 500;
            font-size: 18px;
            color: #0b132a;
            margin-top: 30px;
          }
          ul {
            margin-bottom: 50px;
            margin-top: 20px;
            li {
              margin-top: 10px;
              font-size: 14px;
              padding-left: 45px;
              position: relative;
              &::before {
                content: "";
                position: absolute;
                top: 50%;
                left: 0;
                transform: translateY(-50%);
                width: 24px;
                height: 24px;
                background: url("/static/check.svg") no-repeat center / cover;
              }
            }
          }
          .plan-price {
            font-weight: 500;
            font-size: 25px;
            line-height: 30px;
            text-align: center;
            color: #0b132a;
            margin-bottom: 20px;
            span {
              font-weight: 100;
            }
          }
          .plan-btn {
            color: $pink;
            font-weight: 500;
            padding: 8px 40px;
            background-color: #fff;
            border: solid 1px $pink;
            border-radius: 99999px;
            transition: all 0.5 ease;
            &:hover {
              background-color: $pink;
              color: #fff;
              transition: all 0.5 ease;
              box-shadow: 0px 30px 54px -10px rgba(245, 56, 56, 0.35);
            }
          }
        }
      }
    }
    @media screen and (max-width: 1200px) {
      padding: 3rem 0;
      .plan-wrapper {
        padding: 2rem;
        .plan-item-wrapper {
          padding: 0 10px;
          .plan-item {
            padding: 3rem 1rem;
          }
        }
      }
    }
  }
  .network {
    padding-top: 100px;
    .section-des {
      margin-bottom: 100px;
    }
    .network-img {
      padding: 0 50px;
      width: 100%;
      height: auto;
      object-fit: cover;
    }
  }
  .customer {
    padding-top: 100px;
    padding-bottom: 150px;
    .comment-text {
      margin-top: 20px;
      color: #0b132a;
      line-height: 30px;
    }
    .comment {
      padding-top: 100px;
